    def makeFrenchAllTerritories(self) -> dict:
        geoJSON:dict = copy.deepcopy(self.French)
        aFeatures = geoJSON[poaffCst.cstGeoFeatures]
        aAreas:list = [self.Corse, self.LaReunion, self.GuyaneFr, self.StPierreEtMiquelon, self.AntillesFr, self.Mayotte, self.PolynesieFr, self.NouvelleCaledonie]
        for gJS in aAreas:
            oFeature = gJS[poaffCst.cstGeoFeatures][0]
            aFeatures.append(oFeature)
        #bpaTools.writeJsonFile(self.inputPath + "__geoFrenchAll_border.geojson", geoJSON)
        return geoJSON

    #Controle de conformité de la fermeture d'une zone. Erreur levée si le premier-point de la géométrie est différent du dernier
    def ctrlZone(self, oZone) -> None:
        bError:bool = False
        aArray:list = None
        if isinstance(oZone, list):
            aArray = oZone
            bError = bool(aArray[0] != aArray[-1])
        elif isinstance(oZone, dict):
            sZoneType:str = oZone.get(poaffCst.cstGeoType, None)
            if sZoneType in [poaffCst.cstGeoPoint, poaffCst.cstGeoMultiPoint, poaffCst.cstGeoLine, poaffCst.cstGeoMultiLine]:
                return  #Pas besoin de contrôle
            elif sZoneType  == poaffCst.cstGeoPolygon:
                for oCoord in oZone[poaffCst.cstGeoCoordinates]:
                    self.ctrlZone(oCoord)
            elif sZoneType == poaffCst.cstGeoMultiPolygon:
                for oSector in oZone[poaffCst.cstGeoCoordinates]:
                    for oCoord in oSector:
                        self.ctrlZone(oCoord)
            elif sZoneType == poaffCst.cstGeoFeatureCol:
                for oFeat in oZone[poaffCst.cstGeoFeatures]:
                    self.ctrlZone(oFeat[poaffCst.cstGeoGeometry])
            else:
                raise Exception("Unqualified type of area")
        else:
            raise Exception("Unqualified type of area")

        if bError:
            sHeader = "[" + bpaTools.getFileName(__file__) + "." + self.setZone.__name__ + "()] "
            sMsg = "/!\ Area Error - firstPoint={0} != lastPoint={1}".format(aArray[0], aArray[-1])
            raise Exception(sHeader + sMsg)
        return

    def ctrlAreasRef(self) -> None:
        try:
            for sRef, oRef in self.AreasRef.items():
               self.ctrlZone(oRef[enuAreasRef.geoJSON.value])
            return
        except Exception as e:
            sHeader = "[" + bpaTools.getFileName(__file__) + "." + self.ctrlAreasRef.__name__ + "()] "
            sMsg = "/!\ Evaluation Error - AreaRef={0}".format(sRef)
            raise Exception(sHeader + sMsg + " / " + str(e))

    #Returns a new shapely.geometry:shape
    def makeGeometryShape(self, oZone):
        oRet = None
        oGeoZone:dict = None
        #old - if isinstance(oZone, list):
        #    oGeoZone = {poaffCst.cstGeoType:poaffCst.cstGeoPolygon, poaffCst.cstGeoCoordinates:[oZone]}
        #elif isinstance(oZone, dict):
        #    oGeoZone = oZone
        #if oGeoZone != None:
        #    if len(oGeoZone[poaffCst.cstGeoCoordinates]) > 0:
        #        oRet = shape(oGeoZone)
        if isinstance(oZone, list):
            oGeoZone = {poaffCst.cstGeoType:poaffCst.cstGeoPolygon, poaffCst.cstGeoCoordinates:[oZone]}
            oRet = shape(oGeoZone)
        elif isinstance(oZone, dict):
            sZoneType:str = oZone.get(poaffCst.cstGeoType, None)
            if sZoneType in [poaffCst.cstGeoPoint, poaffCst.cstGeoMultiPoint, poaffCst.cstGeoLine, poaffCst.cstGeoMultiLine, poaffCst.cstGeoPolygon, poaffCst.cstGeoMultiPolygon]:
                oRet = shape(oZone)
            elif sZoneType == poaffCst.cstGeoFeatureCol:
                geoCol:list = []
                for oFeat in oZone[poaffCst.cstGeoFeatures]:
                    geoCol.append(shape(oFeat[poaffCst.cstGeoGeometry]))
                    oRet = GeometryCollection(geoCol)
        return oRet

    def setZoneRef(self, oZoneRef) -> bool:
        self.oShapeZoneRef = self.makeGeometryShape(oZoneRef)
        return

    def setZone(self, oZone) -> None:
        self.ctrlZone(oZone)
        self.oShapeZone = self.makeGeometryShape(oZone)
        return

    #Renvoie True si :
    #   si la zone envoyée est incluse dans la zone de référence
    #   si la frontière ou l'intérieur de la zone envoyée se croise de quelque façon avec la zone de référence
    def isInclude(self, oZone=None, oZoneRef=None) -> bool:
        if oZone   !=None:      self.setZone(oZone)
        if oZoneRef!=None:      self.setZoneRef(oZoneRef)

        ###For control of areas ; use http://geojson.tools)
        #g = []
        #g.append({poaffCst.cstGeoType:poaffCst.cstGeoFeature, poaffCst.cstGeoProperties:{}, poaffCst.cstGeoGeometry:gZone})
        #g.append({poaffCst.cstGeoType:poaffCst.cstGeoFeature, poaffCst.cstGeoProperties:{}, poaffCst.cstGeoGeometry:self.oShapeZoneRef})
        #geojson = {poaffCst.cstGeoType: poaffCst.cstGeoFeatureCol, poaffCst.cstGeoFeatures:g}
        #print(str(geojson).replace(chr(39),chr(34)))

        bWithin = self.oShapeZone.within(self.oShapeZoneRef)
        if not bWithin:
            bIntersects = self.oShapeZone.intersects(self.oShapeZoneRef)
        return bool(bWithin or bIntersects)

    def evalAreasRefInclusion(self, sName, oZone) -> dict:
        ret:dict = {}
        sRef:str = ""

        try:
            self.setZone(oZone)
            if self.oShapeZone == None:
                return ret
            for sRef, oRef in self.AreasRef.items():
                oRefZone        = oRef[enuAreasRef.geoJSON.value]
                sRefBaseInclude = oRef[enuAreasRef.baseName.value]
                if oRefZone==None:
                    bRet = True
                else:
                    bRet = self.isInclude(None, oRefZone)
                if bRet and sRefBaseInclude:        #Contrôle d'une acceptation par combinaison de référence
                    bRet = ret[sRefBaseInclude]
                ret.update({sRef:bRet})
            return ret
        except Exception as e:
            sHeader = "[" + bpaTools.getFileName(__file__) + "." + self.evalAreasRefInclusion.__name__ + "()] "
            sMsg = "/!\ Evaluation Error - AreaName={0} - AreaRef={1}".format(sName, sRef)
            raise Exception(sHeader + sMsg + " / " + str(e))


